import './directions.module.scss'

function Directions({level}) {
    return (
      <section className="directions">
        <div>
            <div>
                <div>
                    <b>{level}</b>

                    <span></span>
                </div>
                
            </div>
        </div>
        
      </section>
    );
  }
  
  export default Directions;
